import React from "react";
import "../Layout.css";
import newsText from "../data/newsText.json";

function News() {
  return (
    <div className="rules-container">
      <div className="outer-card">
        <h1>Nyheter</h1>
        <div className="inner-card">
          {newsText.paragraphs.map((newsItem, index) => (
            <div
              key={index}
              style={{
                fontWeight: 600,
                wordWrap: "break-word",
                overflowWrap: "break-word",
                marginBottom: "16px",
              }}
            >
              <h2>{newsItem.title}</h2>
              <p>{newsItem.body}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default News;
